ocaldev/?p=37',0,'post','',0),(38,0,'2023-03-06 16:22:42','2023-03-06 16:22:42','','Post 29','','publish','open','open','','post-29','','','2023-03-06 16:22:42','2023-03-06 16:22:42','',0,'http://wp.docker.localdev/?p=38',0,'post','',0),(39,0,'2023-03-06 16:22:42','2023-03-06 16:22:42','','Post 30','','publish','open','open','','post-30','','','2023-03-06 16:22:42','2023-03-06 16:22:42','',0,'http://wp.docker.localdev/?p=39',0,'post','',0),(40,1,'2023-03-06 16:24:11','2023-03-06 16:24:11','<!-- wp:paragraph -->\n<p>Cookie Policy</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This Cookie Policy explains how our website uses cookies to improve your browsing experience. By using our website, you consent to our use of cookies in accordance with this policy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>What are cookies?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cookies are small text files that are placed on your device (such as your computer, tablet, or smartphone) when you visit a website. Cookies are used to collect information about your browsing behavior, preferences, and interests.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>How do we use cookies?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use cookies to improve your browsing experience and to provide you with relevant content and personalized advertising. Some of the ways in which we use cookies include:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Analyzing website traffic and user behavior to improve our website</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Customizing the content and advertisements that you see based on your interests and preferences</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Allowing you to log in to our website and access your account information</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Remembering your preferences and settings for future visits to our website</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>What types of cookies do we use?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We use both session cookies (which expire when you close your browser) and persistent cookies (which remain on your device for a set period of time or until you delete them). Some of the types of cookies that we use include:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Strictly necessary cookies: These cookies are essential for the functioning of our website and cannot be disabled. They are used to enable core website functionality, such as accessing secure areas of the website.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Performance cookies: These cookies collect information about how visitors use our website, such as which pages are visited most frequently and how users navigate through the website. This information is used to improve the website\'s performance and functionality.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Functionality cookies: These cookies allow our website to remember your preferences and settings, such as your language preferences and font size.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Advertising cookies: These cookies are used to deliver personalized advertisements based on your interests and browsing behavior.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>How can you control cookies?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Most web browsers allow you to control cookies through their settings preferences. You can choose to block cookies, delete cookies, or set your browser to alert you when cookies are being sent. However, please note that disabling cookies may impact your browsing experience and prevent you from accessing certain features of our website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Changes to this Cookie Policy</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may update this Cookie Policy from time to time. If we make any changes, we will post the updated policy on our website and update the policy\'s effective date.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any questions or concerns about our use of cookies, please contact us using the information provided on our Contact page.</p>\n<!-- /wp:paragraph -->','Cookies','','publish','closed','closed','','cookies','','','2023-03-06 16:32:32','2023-03-06 16:32:32','',0,'http://wp.docker.localdev/?page_id=40',0,'page','',0),(41,1,'2023-03-06 16:24:11','2023-03-06 16:24:11','<!-- wp:paragraph -->\n<p>Thank you for your interest in contacting us. Our shop is located in Factory Berlin at Sample Str. If you need to get in touch with us, please use the following contact information:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Phone: +49-30-123456789</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Email: <a href=\"mailto:info@ourcompany.com\">info@ourcompany.com</a></li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Address: Sample Str. 76, 10115 Berlin, Germany</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>You can also fill out the form below to send us a message directly. We will do our best to respond to your inquiry as soon as possible.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are available during our regular business hours, which are Monday to Friday from 9am to 6pm. If you need assistance outside of these hours, please leave us a message and we will get back to you as soon as possible. Thank you for choosing our shop and we look forward to hearing from you!</p>\n<!-- /wp:paragraph -->','Contact','','publish','closed','closed','','contact','','','2023-03-06 16:31:41','2023-03-06 16:31:41','',0,'http://wp.docker.localdev/?page_id=41',0,'page','',0),(42,1,'2023-03-06 16:24:11','2023-03-06 16:24:11','<!-- wp:paragraph -->\n<p>Welcome to our Laptop Shop! We offer a wide selection of laptops from top brands, including HP, Lenovo, Framework, System76, Toshiba, and many more. Whether you need a laptop for work, school, gaming, or entertainment, we have the perfect laptop for you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our laptops come in a variety of sizes, from compact and lightweight models for on-the-go use to larger models with powerful processors and high-resolution displays for the ultimate computing experience. We also offer a range of specifications to suit your needs and budget, including varying amounts of RAM, storage, and graphics capabilities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In addition to our wide range of laptops, we also provide a range of services to help you get the most out of your new device. Our knowledgeable and friendly staff can assist you in finding the perfect laptop for your needs, as well as offer advice on accessories, software, and more. We also provide on-site technical support and repairs, so you can rest assured that your laptop is in good hands.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>At our Laptop Shop, we pride ourselves on providing high-quality products and exceptional customer service. We are dedicated to helping you find the perfect laptop to suit your needs, and we look forward to working with you.</p>\n<!-- /wp:paragraph -->','About','','publish','closed','closed','','about','','','2023-03-06 16:29:36','2023-03-06 16:29:36','',0,'http://wp.docker.localdev/?page_id=42',0,'page','',0),(43,1,'2023-03-06 16:24:11','2023-03-06 16:24:11','<!-- wp:paragraph -->\n<p>Sure, here\'s a sample text for a FAQ page for a laptop store:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Frequently Asked Questions (FAQ)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: What types of laptops do you sell? A: We sell a wide range of laptops from top brands, including HP, Lenovo, Framework, System76, Toshiba, and many more. Our laptops come in various sizes and specifications to suit your needs and budget.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: Do you offer any warranties or guarantees on your laptops? A: Yes, we offer manufacturer warranties on all of our laptops. In addition, we provide a 30-day money-back guarantee on all purchases. If you are not satisfied with your laptop for any reason, you can return it within 30 days for a full refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: Do you offer any financing options? A: Yes, we offer financing options through third-party providers. Please contact us or visit our store for more information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: Can I get technical support or repairs for my laptop? A: Yes, we offer on-site technical support and repairs for all laptops purchased from our store. Our experienced technicians can diagnose and fix any issues you may be experiencing with your laptop.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: Do you offer any discounts or promotions? A: Yes, we frequently offer discounts and promotions on our laptops. Please check our website or visit our store for current offers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: Can I customize my laptop with specific specifications? A: Yes, we offer customized laptop options with specific specifications. Please contact us or visit our store for more information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: What payment methods do you accept? A: We accept various payment methods, including cash, credit cards, and debit cards. We also offer financing options through third-party providers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Q: Do you offer any trade-in programs? A: Yes, we offer trade-in programs for certain laptops. Please contact us or visit our store for more information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any further questions or concerns, please do not hesitate to contact us using the information provided on our Contact page. Our knowledgeable and friendly staff are always here to assist you.</p>\n<!-- /wp:paragraph -->','FAQ','','publish','closed','closed','','faq','','','2023-03-06 16:33:20','2023-03-06 16:33:20','',0,'http://wp.docker.localdev/?page_id=43',0,'page','',0),(44,1,'2023-03-06 16:24:11','2023-03-06 16:24:11','','Home','','publish','closed','closed','','home','','','2023-03-06 16:26:00','2023-03-06 16:26:00','',0,'http://wp.docker.localdev/?page_id=44',0,'page','',0),(45,1,'2023-03-06 16:24:30','2023-03-06 16:24:30','','about','','inherit','closed','closed','','42-revision-v1','','','2023-03-06 16:24:30','2023-03-06 16:24:30','',42,'http://wp.docker.localdev/?p=45',0,'revision','',0),(46,1,'2023-03-06 16:24:42','2023-03-06 16:24:42','','About','','inherit','closed','closed','','42-revision-v1','','','2023-03-06 16:24:42','2023-03-06 16:24:42','',42,'http://wp.docker.localdev/?p=46',0,'revision','',0),(47,1,'2023-03-06 16:24:50','2023-03-06 16:24:50','','Contact','','inherit','closed','closed','','41-revision-v1','','','2023-03-06 16:24:50','2023-03-06 16:24:50','',41,'http://wp.docker.localdev/?p=47',0,'revision','',0),(48,1,'2023-03-06 16:25:00','2023-03-06 16:25:00','','Cookies','','inherit','closed','closed','','40-revision-v1','','','2023-03-06 16:25:00','2023-03-06 16:25:00','',40,'http://wp.docker.localdev/?p=48',0,'revision','',0),(49,1,'2023-03-06 16:25:08','2023-03-06 16:25:08','','Home','','inherit','closed','closed','','44-revision-v1','','','2023-03-06 16:25:08','2023-03-06 16:25:08','',44,'http://wp.docker.localdev/?p=49',0,'revision','',0),(50,1,'2023-03-06 16:25:20','2023-03-06 16:25:20','','FAQ','','inherit','closed','closed','','43-revision-v1','','','2023-03-06 16:25:20','2023-03-06 16:25:20','